import React, { Component } from 'react';
import "./Node.css";

export default class node extends Component{
    constructor(props){
        super(props);
        this.state = {
            isWall:this.props.isWall,
        }
    }
    

    render(){
        const extraclassName = this.props.isEnd? 'node-end': this.props.isStart? 'node-start': this.props.isWall?'node-wall':'';
        return <div 
        id={`${this.props.row}-${this.props.col}`}
        className={`node ${extraclassName}`}
        onClick = {() => {console.log(`Hello from ${this.props.row}-${this.props.col}`);}}
    />
    }
}



